import React from 'react'
// 引入NavLink 组件
import { NavLink } from "react-router-dom";
import './menu.css'

const selectedStyle = {
    backgroundColor: 'white',
    color: 'slategray'
  }

  const title = "title1";
  class Menu extends React.Component{

    render(){
        return(
            <nav className='main-menu col-md-4 col-md-offset-0'>
            <NavLink to='/'>首页</NavLink>
            <NavLink to='/about' activeStyle = {selectedStyle}>关于我们</NavLink>

            <NavLink to={`/pages/${title}`}> click </NavLink>


            <NavLink to='/createPage' activeStyle = {selectedStyle}>create new page</NavLink>
          </nav>


        )
    }
  }

  export {Menu};
